func (cc *CabinetCreate) OnConflictColumns(columns ...string) *CabinetUpsertOne {
	cc.conflict = append(cc.conflict, sql.ConflictColumns(columns...))
	return &CabinetUpsertOne{
		create: cc,
	}
}

